import logo from './logo.svg';
import './App.css';

function App() {
  const header = <nav className='nav-bar'>
    <p>Logo</p>
    <ul>
      <li>
        <a href="/">Home</a>
      </li>
      <li>
        <a href="/">Contact</a>
      </li>
    </ul>
  </nav> 
  return (
    <div>
      {header}
        <h1>Homepage</h1>
        <p>This is the homepage.</p>
    </div>    
  );
}

export default App;
